import React, { Component } from 'react'

export default class Radio extends Component {
    render() {
        return (
            <div>

                <input type="radio" value="1"   />
                <label htmlFor="">Yes</label>
                <input type="radio" value="1"  />
                
            </div>
        )
    }
}
